import React from 'react';


const Header = () => {
  return (
    <header className='py-1'>
      <div className='container mx-auto'>
        <p className='text-right text-gray-500 from-neutral-400 text-[14px]'>Version 0.1</p>
      </div>
    </header>
  );
};

export default Header;
